*
 * 更改 App 顶栏的背景色
 *
 * @param {string} params.backgroundColor
 *
 * @returns {Promise<*>}
 *
 * @example
 * lib.exec('control-action-bar-style', {
    params: {
      backgroundColor: '363546',
    },
  }).then((info) => {
    alert(`[refresh][control-action-bar-style][then] ${JSON.stringify(info, null, 2)}`);
  }).catch((err) => {
    alert(`[refresh][control-action-bar-style][error] ${JSON.stringify(err, null, 2)}`);
  });

